script: |
  super -f text -I q9050.spq | sort > q9050.out

inputs:
  - name: q9050.spq
    data: |
      SELECT DISTINCT + 41 AS col0 FROM tab1 (FORMAT parquet) WHERE NOT - 0 NOT BETWEEN + CAST ( + ( + col1 ) AS INTEGER ) * 70 AND + 7 * - col1;
  - name: tab1

outputs:
  - name: q9050.out
    data: |
